  input: '"TEXT","F3XA","C00143743","This report corrects the cash on hand balances
    previously reported incorrectly due to incorrect balance forward.      Line 30(b)
    is also adjusted for FEA activity.  Activity reported for Early Voting Slate Mail
    Piece is both exempt and FEA activity.   The mail piece contained 3 candidates,
    identified the office sought and party affiliation.  The piece was a GOTV direct
    mail piece.    Postage and fundraising expenses identified on Line 21 have also
    been designated as RPT (State Party) expenditures.    As identified earlier in
    FORM 99 - #175072, the $172,906.11 which was omitted on the first report filed
    consists of two nonfederal fund transfers.  There is little specific information
    to clarify why the amount was omitted from the original report, other than the
    time period in which the original report was filed.  In discussions with our long-term
    staff in accounting, I have discovered that during September, a consultant was
    hired to recruit a replacement for the Director of Accounting for the Party.  Due
    to timing, he was also required to prepare reports.  By the end of September,
    the new Director was in place, however, with no prior training regarding preparation
    of the reports.  I have looked for a spreadsheet or backup information on the
    report and didnt find one.  Prior to September, a detailed spreadsheet was used
    by the Director to prepare the reports.  There is nothing to clarify who was responsible
    for the actual preparation or filing of this specific report.  I have reviewed
    other reports, including the state reports prepared at the same time and found
    that coding within the software was the reason that data was reported incorrectly
    or omitted.  I have tried to find some backup to the preparation but have been
    unable to find any additional information to explain the omission in the original
    report."'
